import React, {Component} from 'react';
import {
    Link
} from "react-router-dom";
import '../App.css';

//files
import new_quest_text from "../img/UI/new_quest_text.png"

class NewQuestView extends Component {
    constructor(props) {
        super(props);
        //delete if not needed
    }

    render() {
        return (
            <div id="newQuestDiv">
                <div id="newQuestTopDiv">
                    <img src={new_quest_text}/>
                </div>
                <div id="newQuestMiddleDiv">
                    <div id="newQuestDifficultyDiv"></div>
                    <div id="newQuestButtonsDiv"></div>
                </div>

            </div>
        );
    }
}

export default NewQuestView;
